export default function Info({tripLocation,start,end,caption}){


    let image
    try{
        image = require(`../UserImages/${tripLocation}/${tripLocation}.jpg`)
    } catch{
        image = require("../UserImages/download.jpg")
    }

    return(
        <div>
            {tripLocation}
            <br>
            </br>
            {start} - {end}
            <br/>
            {caption}
            <img src={image} width={"200px"} 
            />

        </div>
    )

}
